     In Wyoming Territory, a range war is brewing between entrenched cattle barons and new settlers. Cattle king Reese Duncan is opposed by ambitious gambler Jim Averell, who imports his old flame, shapely saloon queen Kate Maxwell, and sets her up as an alternative cattle buyer. As matters build toward violence, Kate finds she's being taken advantage of. But her only potential ally in staving off carnage is seemingly mild-mannered sheriff Stan Blaine...who distrusts her.



